INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (55, 'In A Time to Embrace William Stacy Johnson brilliantly analyzes the religious, legal, and political debates about gay marriage, civil unions, and committed gay couples. This new edition includes updates that reflect the many changes in laws pertaining to civil unions / same-sex marriage since 2006.', 291, 1, true, '2019-11-09 16:39:44.080977');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (51, 'Traces the intellectual and social history of wealth in the early Christian church, examining the financial rise of the church and its effects on the waning Roman empire as well as the church''s own beliefs on poverty.', 287, 1, true, '2019-11-09 16:39:44.044463');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (60, 'Numbering system JUBS Greek text Greek/English concordance BAG Lexicon Kittel Theological Dictionary 6 x 9', 296, 1, true, '2019-11-09 16:39:44.854917');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (56, 'These brief pastoral devotional letters, for the most part, were written monthly or every other month in newsletters sent out to members of congregations I served over a period of years. They are, however, not only for those members but for anyone in need of encouragement and strength in their Christian life. We are blessed to be a blessing.', 292, 1, true, '2019-11-09 16:39:44.084841');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (78, 'Süchtings Standardwerk bietet eine umfassende Einführung in den Bereich der Unternehmensfinanzierung. Aktuellen Entwicklungen, etwa im Bereich der Terminmärkte, der Unternehmensübernahmen und des Finanzmarketings, wird in diesem Nachschlagewerk ideal Rechnung getragen.', 316, 1, true, '2019-11-09 16:39:45.884535');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (1, '"Turning the envelope over, his hand trembling, Harry saw a purple wax seal bearing a coat of arms; a lion, an eagle, a badger and a snake surrounding a large letter ''H''." Harry Potter has never even heard of Hogwarts when the letters start dropping on the doormat at number four, Privet Drive. Addressed in green ink on yellowish parchment with a purple seal, they are swiftly confiscated by his grisly aunt and uncle. Then, on Harry''s eleventh birthday, a great beetle-eyed giant of a man called Rubeus Hagrid bursts in with some astonishing news: Harry Potter is a wizard, and he has a place at Hogwarts School of Witchcraft and Wizardry. An incredible adventure is about to begin! Pottermore has now launched the Wizarding World Book Club. Visit Pottermore to sign up and join weekly Twitter discussions at WW Book Club.', 11, 1, true, '2019-11-09 14:33:26.400430');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (2, '#1 New York Times bestseller! From extremist groups to NASCAR to forensic twists, Temperance Brennan is back in a turbo-charged story of secrets and murder. A body is found in a barrel of asphalt in a landfill just before Raceweek when 200,000 fans are pouring into town. The next day a NASCAR crewmember visits Temperance Brennan at the MCME and tells his story. His sister, Cyndi Gamble, then a high school senior who wanted to be a NASCAR driver, disappeared twelve years before along with her boyfriend, Cale Lovette. Lovette used to hang out with a group of right-wing extremists known as the Patriot Posse. Is the body Cyndi’s? Or Cale’s? At the time of their disappearance, the FBI joined the investigation because of Cale’s association with extremists. But the search was quickly terminated. Was there a cover-up? Tempe considers the multiple theories: did the pair take off together to join the underground militia and then get killed by militia types? Did Cale kill Cyndi and disappear into the militia underground? The case gets more complex when another man, Ted Raines, is identified as missing in Charlotte, where he had gone for the big race. Ted was an employee of the CDC in Atlantic. Could the body be his? What could Raines—if it is Raines—have been up to?', 13, 1, true, '2019-11-09 15:09:34.823155');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (3, 'In the twelfth novel from #1 New York Times bestselling author Kathy Reichs, forensic anthropologist Temperance Brennan finds herself buried alive after being accused of mishandling the autopsy of a Canadian heiress. There are 206 bones in the human body. Forensic anthropologists know them intimately, and can use them to recreate every kind of violent end. Tempe wakes up to discover that she is enclosed in a kind of very small, very dark, very cold space. She is bound, hands to feet, and there’s something wrong with her ankle. Unsure of where she is, Tempe slowly begins to work out what has happened… When the body of a missing heiress was discovered, Temperance Brennan and Lieutenant Ryan accompanied the remains from Montreal to the Chicago morgue. Their trip was soon interrupted when an incriminating phone call accused Tempe of mishandling the autopsy—and the case. But before Tempe could face her accuser, the one man with information about the call died, and Tempe was left in the dark. As the facts slowly slot into place, Tempe wonders who wants her dead, or at least out of the way, and why? Pulse-pounding, electrifying, and seamlessly weaving between past and present, 206 Bones describes the incredible devastation that occurs when forensic evidence is sabotaged in the lab.', 14, 1, true, '2019-11-09 15:09:34.844285');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (4, 'Books for All Kinds of Readers Read HowYouWant offers the widest selection of on-demand, accessible format editions on the market today. Our 7 different sizes of EasyRead are optimized by increasing the font size and spacing between the words and the letters. We partner with leading publishers around the globe. Our goal is to have accessible editions simultaneously released with publishers'' new books so that all readers can have access to the books they want to read. To find more books in your format visit www.readhowyouwant.com', 55, 1, true, '2019-11-09 15:17:00.452958');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (5, 'Deep in the countryside, ghost hunter David Ash is investigating a mysterious, secluded stately home. Reports from locals regarding strange goings-on make him think the house is haunted... But not even David Ash''s long professional history of warding off evil spirits can prepare him for the shocking discovery that awaits. International bestselling horror writer James Herbert weaves a terrifying narrative featuring his best-loved character, David Ash, the skeptical detective of the paranormal introduced in the UK number one bestsellers, Haunted and The Ghosts of Sleath. Prepare to be chilled to the marrow... At the Publisher''s request, this title is being sold without Digital Rights Management Software (DRM) applied.', 56, 1, true, '2019-11-09 15:17:00.470114');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (6, 'Hunting down a killer and master illusionist whose first of several brutal murders took place at a prestigious New York music school, investigator Lincoln Rhyme and his protTgTe, Amelia Sachs, work together to prevent a terrifying act of vengeance.', 57, 1, true, '2019-11-09 15:17:00.476467');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (7, 'Books for All Kinds of Readers ReadHowYouWant offers the widest selection of on-demand, accessible format editions on the market today. Each edition has been optimized for maximum readability, using our patent-pending conversion technology. We are partnering with leading publishers around the globe to create accessible editions of their titles. Our goal is to have accessible editions simultaneously released with publishers'' new books so that all readers can have access to the books they want to read today. To find more books in your format visit www.readhowyouwant.com', 58, 1, true, '2019-11-09 15:17:00.481646');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (30, 'Twenty-nine collected essays represent a critical history of Shakespeare''s play as text and as theater, beginning with Samuel Johnson in 1765, and ending with a review of the Royal Shakespeare Company production in 1991. The criticism centers on three aspects of the play: the love/friendship debate.', 266, 1, true, '2019-11-09 16:39:42.480310');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (8, 'THE FIRST DELILAH WEST NOVEL BY MAXINE O’CALLAGHAN HONORED BY THE PRIVATE EYE WRITERS OF AMERICA WITH THEIR LIFETIME ACHIEVEMENT AWARD. Ex-cop Delilah West is working as a PI with her husband Jack when he’s killed while investigating a missing person’s case. Grief-stricken and enraged, she becomes obsessed with finding the killer…only to wake up drugged in a skid-row hotel room with him lying beside her with a knife in his back. It’s the perfect frame, nailing her for an obvious revenge killing. Now she’s on the run…living on a razor’s edge trying to avoid capture while searching for the murderers who’ve destroyed her life.', 156, 1, true, '2019-11-09 16:39:28.154234');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (9, 'Thorough coverage of the improvements and changes to SharePoint 2010 SharePoint 2010 boasts a variety of incredible new features that will challenge even the most experienced administrator who is upgrading from SharePoint 2007. Written by a team of SharePoint experts, this book places a takes aim at showing you how to make these new features work right for you. Offering an in-depth look at SharePoint 2010, the authors focus on how SharePoint functionality has changed from its earliest version to its newest, and they provide you with detailed coverage of all the new features and capabilities. Presents in-depth coverage of the new features and functions of SharePoint 2010 Demonstrates installation, configuration, and upgrading existing SharePoint 2007 servers Discusses architecture and capacity planning, securing and managing site content, and integrating Office clients Details the protocol for handling monitoring, creating backups, and executing disaster recovery Addresses shared service applications, navigation and governance, and business intelligence and reporting services Professional SharePoint 2010 presents a solid understanding of the functionality that SharePoint 2010 provides, which will allow you to see what it can do for you.', 245, 1, true, '2019-11-09 16:39:41.220695');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (10, 'In Net Work, Patti Anklam takes on the jumble, hype, and academic jargon about networks - social, personal, and organizational - and creates a straightforward and comprehensive introduction for the lay practitioner. Beginning with a framework of network types, structures, and styles, Net Work is a guide to methods for analyzing, making sense of, governing, and managing change in networks. If you are a manager trying to understand how to work across network boundaries, an entrepreneur thinking about creating a networked business, or a citizen of the world who wants to use a network to make a difference, you will find that Net Work will give you the language, insights, and directions to get you started on the path to making networks work.', 246, 1, true, '2019-11-09 16:39:41.250870');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (11, 'The main topic of this volume is natural multimodal interaction. The book is unique in that it brings together a great many contributions regarding aspects of natural and multimodal interaction written by many of the important actors in the field. Topics addressed include talking heads, conversational agents, tutoring systems, multimodal communication, machine learning, architectures for multimodal dialogue systems, systems evaluation, and data annotation.', 247, 1, true, '2019-11-09 16:39:41.263772');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (12, 'Introduction to key background information on India, its culture and its history as well as its industry. Step-by-step guide through the whole outsourcing process. Guidance from leading managers and industry experts. Each chapter can be used as a primer on a particular subject. Updated information on companies and the Indian market.', 248, 1, true, '2019-11-09 16:39:41.281985');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (13, 'This book is the fifth volume of the CoreGRID series. Organized jointly with the Euro-Par 2007 conference, The CoreGRID Symposium intends to become the premiere European event on Grid Computing. The aim of this symposium is to strengthen and advance scientific and technological excellence in the area of Grid and Peer-to-Peer Computing. The book includes all aspects of Grid Computing including service infrastructure. It is designed for a professional audience composed of researchers and practitioners in industry. This volume is also suitable for advanced-level students in computer science.', 249, 1, true, '2019-11-09 16:39:41.298660');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (14, 'Create and modify databases and keep them secure Get up to speed on using T-SQL to store and manipulate data SQL Server 2005 improves an already great database management system. This book shows you how to put it to work in a hurry. You''ll find out how to use the SQL Server Management Studio and the SQLCMD utility to write T-SQL code, retrieve data from single or multiple SQL Server tables, add data using the INSERT statement, and much more. * Create queries to retrieve data * Ensure SQL Server security * Use Visual Studio(r) 2005 with SQL Server * Create tables, views, and indexes * Work with Common Language Runtime * Query XML data', 250, 1, true, '2019-11-09 16:39:41.313276');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (15, 'This book constitutes the refereed proceedings of the 4th International Workshop on Multiple Access Communications, MACOM 2011, held in Trento, Italy, in September 2011. The 21 full papers papers presented were carefully reviewed and selected from more than 40 submissions. They are divided in topical sections on cognitive radio; MAC protocols; communications theory; special session on MAC protocols for WSNs; system analysis and scheduling; and queuing systems.', 251, 1, true, '2019-11-09 16:39:41.326722');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (16, 'Referat (Handout) aus dem Jahr 2002 im Fachbereich Informatik - Allgemeines, Note: 2, Justus-Liebig-Universität Gießen (Repetitorium), Veranstaltung: Referat zur Einführung in die Wirtschaftsinformatik, Sprache: Deutsch, Abstract: Die folgenden Seiten stellen eine kurze Einführung in die Datenbankverwaltung mittels Microsoft Access 97 anhand zahlreicher Fallbeispiele incl. deren Lösungen dar. Da es nicht Ziel dieser Einführung ist, eine theoretische Abhandlung über Datenbanken zu liefern, wurde der theoretische Teil auf die erste Seite beschränkt. Anschließend folgt eine Kurzbeschreibung von Abfragetypen (Auswahl- und Löschabfragen), sowie die Formularerstellung, gefolgt von Fallbeispielen und zahlreichen screenshots zum einfacheren Nachvollziehen.', 252, 1, true, '2019-11-09 16:39:41.350746');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (17, 'In thispa per, we describe the key lessons from an earlier HCI Educators'' conference, held in Limerick in 2006, on ''inventivity'' – a term coined to highlight the confluence of inventiveness and creativ ity. There is a distinction between being creative andbein g artistic. HCI education, in terms of creative inventiveness, is not just about artistically pleasing user inte rfaces, but also about solutions that are innovative. We can know much about creativ ity and inventiveness. However, tobe able to teach and train students so that th ey can be creatively inventive, we believe that it would be helpful if educators themselves have personally experienced this. With this in mind, we organised the follow up conference HCIEd 2007 Creativity: Experiencing to Educate and Design. Inventivity was coined to refer to the notiono f inventing creative and innovative solutions. This term was also intended tomean that such solutionsb e more than ''creative'', artistic or appealing interfaces as designed by artistic or ''creative types'' of people. It was also intended to reflect the creativeness of the solutions that had to be invented. One reason for emphasising this as pect at the conference was that, in HCI design it is easy to mis interpret the focus ofHCI d esign solutions – which should notad dress just visualisation and interaction design, but also address how that visualisation and interactioncreativ ely repr esents and simplifies the complexities in work thatpe ople engage in.', 253, 1, true, '2019-11-09 16:39:41.362116');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (53, 'Unique in all of literature, the Confessions combines frank and profound psychological insight into Augustine''s formative years along with sophisticated and beguiling reflections on some of the most important issues in philosophy and theology. The essays contained in this volume, by some of the most distinguished recent and contemporary thinkers in the field, insightfully explore Augustinian themes not only with an eye to historical accuracy but also to gauge the philosophical acumen of Augustine''s reflections.', 289, 1, true, '2019-11-09 16:39:44.064227');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (18, 'By their adoption of Agenda 21, most of the world''s governments have acknowledged the need for sustainable development. This implies that new policies are needed, focusing on economic, social, cultural and ecological goals. At the same time, we also need to solve existing environmental and social problems, and prevent the occurrence of new ones. This volume presents, tests and illustrates a theoretically well-founded procedure for discovering regional opportunities for sustainable development, based on a systems approach to decision making. The procedure takes as its starting point the needs of the people involved, relating these to the measurement of available resources in order to find opportunities for multiple resource use and sustainable development. The needs of future generations and broader communities are taken into account throughout. The book studies regional planning and the implementation of plans, offering guidance and support to parties involved in debates on sustainable development, and improving the quality of their decision making.', 254, 1, true, '2019-11-09 16:39:41.873249');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (19, 'This book recounts the issues raised and the viewpoints aired at a recent symposium on repository licensing. It summarizes the problems surrounding the setting of an Environmental Protection Agency standard for the release of radionuclides and the regulatory problems inherent in meeting such a standard. Symposium participants came from a variety of federal agencies and advisory groups, state governments, public interest groups, engineering firms, national laboratories, and foreign and international organizations. The book illustrates the strong feeling in the radioactive waste disposal community that changes must be made if the United States is to fulfill its promise of safe management of current and future nuclear waste.', 255, 1, true, '2019-11-09 16:39:41.890504');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (20, 'This book provides the first coherent account of a well-known approach to the problem of light scattering by small anisotropic particles. In this extended second edition the authors have encompassed all the new topics arising from their recent studies of cosmic dust grains. Thus many chapters were deeply revised and new chapters were added. The book addresses a wide spectrum of applications.', 256, 1, true, '2019-11-09 16:39:41.911601');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (21, 'Timothy P. Duane documents the impact of rapid population growth on the culture, economy, and ecology of the Sierra Nevada since the late 1960s. He also recommends innovative policies for mitigating the negative effects of future population growth in this spectacular but threatened region, as well as throughout the rural west.', 257, 1, true, '2019-11-09 16:39:41.929950');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (22, 'Why Science? We are fascinated by discovery: who discovered what, and how? This ranges from a look outward at the night sky with scientists like Kepler, astronauts like Neil Armstrong, to physicist like Einstein, chemists like Marie Curie and Linus Pauling, an inward look at psychologists such as Skinner and Maslow, and philosophers like Plato. Join Keating as he explores the pursuit of scientific discovery from his background as a physicists and a long career in the margins of the academic world.', 258, 1, true, '2019-11-09 16:39:41.938360');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (23, 'Studienarbeit aus dem Jahr 2002 im Fachbereich Geowissenschaften / Geographie - Wirtschaftsgeographie, Note: 1, Rheinisch-Westfälische Technische Hochschule Aachen (Geographisches Institut), Sprache: Deutsch, Abstract: Wasserwege sind die ältesten Handels- und Verkehrswege überhaupt. Ihre Bedeutung nahm auch mit der zunehmenden Entstehung von Strassen nicht ab, sondern ist auch gerade heute von grosser Wichtigkeit. Damals waren es vor allem der schlechte Zustand vieler Wege und Strassen, der den Transport von Waren besonders auf längeren Distanzen problematisch machten (was natürlich auch heute in vielen Ländern eine Rolle spielt). Hinzu kamen Wegzölle und die beschränkten Transportmöglichkeiten (v.a. bzgl. der zu transportierenden Mengen). Zudem würden verkehrstechnische Gründe eine Beförderung solch grosser Mengen, wie sie heute von Schiffen bewältigt werden, nicht zulassen. Die räumliche Anordnung von Handel und (später) Industrie, und somit auch die wirtschaftliche Bedeutung einer Region oder eines (Stand)ortes, ist somit ursprünglich immer an Wasserwege gebunden gewesen. Grundsätzlich ist der Prozess der Ausbreitung der Industrie „nicht denkbar ohne den vorausgehenden oder mindestens gleichzeitigen Ausbau leistungsfähiger Verkehrssysteme“ [Voppel, G.; Die Industrialisierung der Erde, Teubner 1990]. Heute ist der Transport von Gütern auf dem Wasserwege eine umweltfreundliche und kostengünstige Alternative zum Transport auf der Strasse oder auf dem Luftweg. Die durchschnittlichen Transportkosten pro Tonne eines Grosstankers von 400000 dwt (Ladefähigkeit = dead weight tons, gesamtes Zuladungsgewicht eines Handelsschiffes) belaufen sich auf weniger als die Hälfte der Kosten eines Tankers mit 80000 dwt Tragfähigkeit [Voppel, G.; Die Industrialisierung der Erde, Teubner 1990; aus: R. Stromberg und H. Glockner S. 167]. Schifffahrt und Häfen sichern Arbeitsplätze und sind somit eine Grundlage für Wirtschaftswachstum in vielen Regionen. Hafen- und Logistikwirtschaft sowie der damit verbundene Aussenhandel sind Wachstumsmotoren der Wirtschaft und somit ein entscheidender Wirtschaftsfaktor. Häfen sind existenzsichernd und darüber hinaus auch identitäts- und imagebildend (was beispielsweise auch für den Tourismus sehr wichtig ist).', 259, 1, true, '2019-11-09 16:39:41.948252');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (25, 'Diese kompakte und klar verständliche Einführung vermittelt alle elementaren chemischen Grundlagen. Ausgehend vom Aufbau der Atome werden Kernreaktionen und chemische Bindung thematisiert. Nach der Einführung der Hauptsätze der Thermodynamik werden chemische Kinetik, Stöchiometrie sowie chemisches Gleichgewicht behandelt. Abschließend finden sich die Themengebiete Säuren und Basen, Redoxreaktionen und Elektrochemie.', 261, 1, true, '2019-11-09 16:39:41.968818');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (26, 'Spanish legend claimed that there were seven cities built of gold and filled with treasure in the New World. Coronado and his troupe spent three years wandering in the American Southwest discovering only the beauty of the landscape. Today he is seen as a', 262, 1, true, '2019-11-09 16:39:42.430884');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (27, 'This remarkable collection contains Isaiah Berlin''s appreciations of seventeen people of unusual distinction in the intellectual or political world, sometimes both. The names of many of them are familiar: Winston Churchill, Franklin D. Roosevelt, Chaim Weizmann, Albert Einstein, and others. With the exception of Roosevelt, he met them all and knew many of them well. For this expanded edition, four new portraits have been added, including those of Virginia Woolf and Edmund Wilson. This volume also contains a vivid and moving account of Berlin''s meetings in Russia with Boris Pasternak and Anna Akhmatova in 1945 and 1956. Perhaps the most fascinating of these "personal impressions" is found in the epilogue, where Berlin describes the three strands in his own personality: Russian, English, and Jewish.', 263, 1, true, '2019-11-09 16:39:42.443424');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (28, 'Private papers, letters, and journals shed new light on Kennedy family relationships and underlie an account of Robert Kennedy''s private and public lives, the forces that shaped him, and his impact on the United States.', 264, 1, true, '2019-11-09 16:39:42.458058');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (29, 'In looking back on four decades of anthropology in the field, Clifford Geertz creates a personal history that is also a retrospective reflection on developments in the human sciences amid political, social, and cultural changes in the world.', 265, 1, true, '2019-11-09 16:39:42.469918');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (83, 'The analysis starts with the practical implications of optimizing behavior for estimation and it follows with a re-examination of the puzzling income elasticity for US imports that three decades of studies have not resolved. The analysis then turns to the study of the role of income and prices in determining the expansion in Asian trade, a study largely neglected in fifty years of research.', 321, 1, true, '2019-11-09 16:39:45.921939');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (32, 'Prepare students for 21st Century Skills and the flood of information they encounter daily! Effective strategies, engaging activities, ideas, resources, and a variety of articles come together in this resource designed to help harness, understand, and use information in today''s digital age. Both students and teachers will benefit from guidelines for evaluating sources of information, judging authenticity of data and trustworthiness of websites, and using information responsibly. Tips for using primary sources in the classroom, plus ideas on concept mapping, graphic organizing, and project-based learning are included. Other topics include netiquette, cyber safety, cyber bullying, and social networking. This resource is aligned to the interdisciplinary themes from the Partnership for 21st Century Skills and supports the Common Core State Standards. 232pp.', 268, 1, true, '2019-11-09 16:39:42.954295');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (33, 'Offers teachers practical and proven methods of instruction for working with a wide variety of learners in their classrooms.', 269, 1, true, '2019-11-09 16:39:42.965568');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (57, '¿Por qué debemos sufrir? ""Si Dios es bueno y todopoderoso, ¿por qué permite que suscriaturas sufran?"" ¿Y qué del sufrimiento de los animales, quienes ni se merecen el dolor ni pueden mejorarse por medio de él? C. S. Lewis, el más importante pensador cristiano de nuestros tiempos, se propone aclarar este tema espinoso en este libro. Con su estilo conocido, su profunda compasión y su extenso entendimiento, el autor ofrece respuestas a estas cruciales preguntas, y comparte su esperanza y su conocimiento para ayudar a sanar a un mundo hambriento por el verdadero entendimiento de la naturaleza humana.', 293, 1, true, '2019-11-09 16:39:44.088422');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (34, 'El llibre Programes d''orientació d''hàbits saludables i per al desenvolupament per a nois i noies entre 12 i 18 anys consta de set programes adreçats a joves entre 12 i 18 anys per tal de prevenir i reeducar hàbits no saludables com: el consum d’alcohol, de tabac, drogues, trastorns d’alimentació, malalties de transmissió sexual i embarassos no desitjats, i millorar la convivència i la interacció social en el marc escolar i extraescolar, evitant l’abandonament escolar i les seves conseqüències. Ofereix recursos als professionals de l’educació (professors, pedagogs, psicopedagogs i educadors socials) per ajudar als joves a prevenir riscos a partir de la creació d’hàbits de salut favorables i que permetin millorar la seva qualitat de vida i el seu desenvolupament global. Els autors d’aquest llibre són professors del Departament de Mètodes d’Investigació i Diagnòstic de la Universitat Autònoma de Barcelona i de Formació de Formadors per a l’aplicació de programes d’intervenció, membres de la Càtedra de formació i Educació Viàries de la UAB i el SCT, i autors de publicacions relacionades en el marc de l’orientació professional i, de l’educació viària des del model de canvi d’actituds.', 270, 1, true, '2019-11-09 16:39:42.977112');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (35, 'Studienarbeit aus dem Jahr 2003 im Fachbereich Deutsch - Pädagogik, Didaktik, Sprachwissenschaft, Note: 1, Johann Wolfgang Goethe-Universität Frankfurt am Main (Institut für Deutsche Sprache und Literatur I), Veranstaltung: Hauptseminar, 19 Quellen im Literaturverzeichnis, Sprache: Deutsch, Abstract: In der nachfolgenden Hausarbeit beschäftige ich mich mit handlungs- und produktionsorientiertem (Literatur-)Unterricht und der damit verbundenen Diskussion um den „richtigen“ Ansatz. Ich beginne mit einer Begriffsklärung und leite dann zu einem geschichtlichen Abriss über, um den Leser mit der Thematik vertraut zu machen. Das 4. Kapitel bietet einen Überblick über die wichtigsten Vertreter der produktionsorientierten Literaturdidaktik. Im 5. Kapitel stelle ich diese Vertreter und ihre Ansätze einzeln vor, um die einzelnen Positionen und die Vielschichtigkeit des Themas offen zu legen. Im Anschluss folgen zwei Kapitel mit Argumenten für und wider produktionsorientierte Verfahren. Ich ende mit der Bedeutung von handlungs- und produktionsorientiertem Unterricht für die Praxis und erläutere die Umsetzung anhand eines Unterrichtsbeispiels für ein 3./4. Schuljahr.', 271, 1, true, '2019-11-09 16:39:42.989497');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (36, 'Diplomarbeit aus dem Jahr 2006 im Fachbereich Sozialpädagogik / Sozialarbeit, Note: 1,1, Evangelische Hochschule Darmstadt, ehem. Evangelische Fachhochschule Darmstadt, Sprache: Deutsch, Abstract: Im Rahmen der Aktion für mehr Selbstbewusstsein „Initiative für wahre Schönheit“, wurden im Auftrag des Kosmetikunternehmens Dove 3300 Frauen im Alter zwischen 15 und 64 Jahren befragt. Anlässlich dieser Erhebung, haben 92 Prozent aller Mädchen zwischen 15 und 17 Jahren geäußert, sie würden gerne mindestens einen Gesichtspunkt ihres Äußeren verändern. Am häufigsten wurde mit 35 Prozent das Gewicht benannt.1 Beängstigend ist der Mangel an Selbstvertrauen, der sich laut der Befragung, für 72 Prozent der Mädchen zwischen 15 und 17 Jahren, auf den Alltag auswirkt. So gaben die Mädchen an, dass sie bestimmte Unternehmungen vermeiden würden, sobald sie mit ihrem Äußeren unzufrieden sind. Zu diesen Aktivitäten zählen Unternehmungen, bei denen sie sich selbst präsentieren müssen, wie beispielsweise Strandgänge oder Sport treiben. So wird sogar für 16 Prozent der Mädchen der Gang in die Schule zu einer Überwindung, die nicht immer bezwungen werden kann. Für Mädchen in der Pubertät und Adoleszenz dient der Körper als zentraler Ort der Identitätsfindung. Gesellschaftlich anerkannte Ideale der Schönheit üben erheblichen Einfluss auf sie aus. Für junge Mädchen sind die Darstellungen von Schönheitsidealen, die z.B. in den Medien repräsentiert werden, ein Vergleichsfeld zu sich selbst. Die Schlagzeilen und Reportagen, die sich mit Schönheit und Körper befassen, sind in den Medien allgegenwärtig. Sie erzeugen das gesellschaftliche Interesse an diesen Themen und spiegeln dies wider. In Einklang mit dem eigenen Körper zu kommen, erscheint in unserer Gesellschaft aus verschiedenen Gründen als eine Lebensaufgabe, deren Ziel recht schwer zu erreichen ist. Heutzutage wird zwar Individualität angestrebt, dennoch wollen viele Menschen gleichzeitig einem normierten Körperschema entsprechen. Dieses Ideal setzt jedoch strenge und irreale Regeln und Vorstellungen vor. So gibt es z.B. seit nicht allzu langer Zeit in Hollywood die Hosengröße Zero, deren Hosenbeine den Umfang eines 12-jährigen Kindes entsprechen. Diese Hosen werden aber von erwachsenen Frauen gekauft und getragen, wie z.B. vom Promi Ex-Spicegirl Viktoria Beckham. In meinem studienbegleitenden Praxissemester bin ich dem Thema Schönheit und Körper immer wieder begegnet. Die Mädchen in der Kinder- und Jugendförderung befanden sich im Alter zwischen 11 und 18 Jahren. Sie standen regelrecht auf Kriegsfuß mit ihrem Körper.', 272, 1, true, '2019-11-09 16:39:42.994450');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (37, 'This book explores the current use and potential of ICT in the secondary history curriculum, and offers sound theory and practical advice to help secondary history teachers use ICT effectively. Key areas covered include: getting started in ICT and history short, medium and long-term planning using ICT to develop historical understanding and skills data handling in the history classroom ICT and maps integrating virtual resources with the real world of teaching and learning. With contributions from leading academics and practitioners in history education, this book will be important reading for all secondary history teachers and trainee teachers, but will be of interest to upper primary school teachers too.', 273, 1, true, '2019-11-09 16:39:42.998430');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (72, 'Grundlagen der Forderungsverbriefung Konzeptionelle Strukturvarianten von ABS-Transaktionen Regulatorische Eigenkapitalunterlegung von Forderungsportfolios nach Grundsatz I Reformierung der Eigenkapitalunterlegung durch Basel II Erfassung von Forderungsverbriefungen in den aufsichtsrechtlichen Regelwerken Jüngste Entwicklungen', 309, 1, true, '2019-11-09 16:39:45.389395');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (54, 'How to make the thorns in your marriage come up roses.The big and little annoyances in your marriage are actually opportunities to deepen your love for each other. Relationship experts and award-winning authors Les and Leslie Parrott believe that your personal quirks and differences—where you squeeze the toothpaste tube, how you handle money—can actually help draw you together provided you handle them correctly. Turn your marriage’s prickly issues into opportunities to love each other more as you learn how to? build intimacy while respecting personal space ? tap the power of a positive marriage attitude ? replace boredom with fun, irritability with patience, busyness with time together, debt with a team approach to your finances . . . and much, much more.Plus—get an inside look at the very soul of your marriage, and how connecting with God can connect you to each other in ways you never dreamed.', 290, 1, true, '2019-11-09 16:39:44.074329');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (38, 'Studienarbeit aus dem Jahr 2008 im Fachbereich Pädagogik - Geschichte der Päd., Note: 2,0, Technische Universität Dresden (Erziehungswissenschaften), Sprache: Deutsch, Abstract: Veränderung ist Fortschritt. Eine der größten Veränderungen in der europäischen Geschichte erfolgte im 19. Jahrhundert und beeinflusste die Gesellschaft grundlegend. Viele Menschen versprachen sich durch die neu entstandenen Fabriken ein besseres Leben in der Stadt als auf dem Lande. Es fand ein Übergang von der Land- zur Stadtbevölkerung statt. Da dieser Übergang ein anderes Leben mit sich zog, mussten die Kinder ebenfalls anders auf dieses Leben vorbereitet werden. Es galt die Menschen zu praktischer Arbeit und selbstständigem Denken zu erziehen. Doch wie sollte man diese neue Form von Erziehung umsetzen? Diese Frage stellten sich viele Reformer die eine Umstrukturierung der Bildung Anfang des 20. Jahrhunderts anstrebten. Ellen Key, John Dewey, Adolphe Ferrière, Georg Michael Kerschensteiner und Célestin Freinet sind nur einige dieser zahlreichen Reformer. Viele zu dieser Zeit entstandenen Ideen endeten als Utopie, andere wiederum sind heute fest in unser Schulsystem eingebettet. Ein sehr erfolgreiches Konzept für eine moderne Schule entwickelte Célestin Freinet, welches in dieser Arbeit beschrieben und untersucht werden soll.', 274, 1, true, '2019-11-09 16:39:43.005037');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (39, 'This book gives practical guidance on doing an action research project. Written for practitioners across professions who are studying on award-bearing courses, this book is packed full of useful advice and takes the reader through the various stages of a project, including: Starting your action research project Monitoring and documenting the action Techniques for dealing with the data Making claims to knowledge and validating them Making your research public: creating your living theory. The book''s practical approach will appeal to practitioners and will encourage them to try out new strategies for improving their work. It will also be essential reading for those resource managers in schools, colleges and higher education institutions who are responsible for providing courses and support. This second edition of a best-selling book, has been thoroughly updated and improved by a number of features, being more accessible, dealing with current debates in literature and demonstrating the power of action research for individual practices.', 275, 1, true, '2019-11-09 16:39:43.010380');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (40, 'GARDNER’S ART THROUGH THE AGES, BACKPACK EDITION: BOOK B: THE MIDDLE AGES is part of an easy-to-carry six-volume set. The most widely-read history of art and architecture in the English language for over 85 years, this beautifully-illustrated set includes new features that make it easier than ever for your students to master the material. Author and award-winning scholar-teacher Fred Kleiner has set a new standard for art history textbooks, continuing GARDNER’S tradition of impeccable reliability and scholarship. The 14th Edition includes a new chapter dedicated to contemporary art worldwide (Books E & F), coverage of over 300 new images, new pedagogical features, images that have been upgraded for clarity and color-fidelity, and more. A comprehensive, integrated set of digital resources brings course content to life, providing students with the tools they need to excel in your class, regardless of their learning styles. GARDNER’s has built its stellar reputation on the inclusion of the most significant images, discussions of the images in their full historical and cultural contexts, reproductions of unsurpassed quality, scholarship that is up-to-date, the consistent voice of a single storyteller, and more online help for students and instructors than any other art survey text. Over 100 reviewers, all experts in their fields, contributed to the accuracy of this edition. CourseMate, the online learning environment that can be used on its own or as an LMS-specific course cartridge, provides an interactive experience for exploration, study, and development of critical thinking skills. It includes an interactive eBook, all images included within the text, nearly 300 videos, audio resources, image flashcards, a printable Slide Guide for note-taking, and much more. Dynamic lecture tools will save instructors time in preparing for class -- a Digital Image Library with full zoom capabilities, side-by-side comparisons, and Google Earth integration. Important Notice: Media content referenced within the product description or the product text may not be available in the ebook version.', 276, 1, true, '2019-11-09 16:39:43.014788');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (41, 'Praxisbezug mit aktuellen Beispielen: Immobilien-Benchmarking ist für das Immobilienmanagement und dessen integrale Betrachtung innerhalb des Immobilienlebenszyklus von entscheidender Bedeutung. Autoren mit umfangreicher Praxiserfahrung beschreiben erforderliche Grundlagen und erläutern alle Elemente des Immobilien-Benchmarking. Sie schließen mit einer kritischen Beurteilung der Möglichkeiten und geben einen Ausblick auf die weitere Entwicklung.', 277, 1, true, '2019-11-09 16:39:43.473238');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (42, 'Mechatronics integrates key systems from mechanical, electrical, electronic, and computer engineering to manufacture industrial products, processes, and operations. Intended as a textbook for courses in mechatronics or as an up-to-date reference for practicing engineers, the book uses extensive in-text, solved examples and computer simulations to cover the basic concepts. This book contains information from both the theoretical and application perspectives related to mechatronic systems. The self-explanatory block diagrams, examples, and numerous illustrations provide the reader with a self-study text to develop systems with motors, circuits, microprocessors, and controls. A CD-ROM with numerous simulations, software, and third-party applications accompanies the print version of the text.', 278, 1, true, '2019-11-09 16:39:43.490291');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (43, 'Modelling and Control of Mini-Flying Machines is an exposition of models developed to assist in the motion control of various types of mini-aircraft: • Planar Vertical Take-off and Landing aircraft; • helicopters; • quadrotor mini-rotorcraft; • other fixed-wing aircraft; • blimps. For each of these it propounds: • detailed models derived from Euler-Lagrange methods; • appropriate nonlinear control strategies and convergence properties; • real-time experimental comparisons of the performance of control algorithms; • review of the principal sensors, on-board electronics, real-time architecture and communications systems for mini-flying machine control, including discussion of their performance; • detailed explanation of the use of the Kalman filter to flying machine localization. To researchers and students in nonlinear control and its applications Modelling and Control of Mini-Flying Machines provides valuable insights to the application of real-time nonlinear techniques in an always challenging area.', 279, 1, true, '2019-11-09 16:39:43.501323');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (50, 'The purpose of this book is to provide athletic coaches with simple methods to enhance their coaching technique. Coaching is teaching. Therefore, coaches must look at their teaching effectiveness in order to become better coaches. In addition, the athletic arena provides a wonderful opportunity for a Christian witness. Often, coaches find it difficult to form a marriage between their coaching and a Christian lifestyle. This book intends to meld the two together, providing clear, effective teacher education and biblical advice to Christian coaches. The book also provides selected scriptures from God''s Word.Can a Christian coach really make a difference? How can one Christian coach save the world of sport? Well, first there is more than one Christian coach out there. Second, if there was only one Christian coach willing to go to battle with Christ, they would fight and win. One coach plus Jesus equals a majority. Recall that it appeared as though David didn''t stand a chance when he went to fight Goliath. David was not alone. David knew that God would be with him. Was he afraid? Maybe, but his faith in God was greater than his fear! Hopefully, this book motivates coaches to allow their faith in Christ to shine through their coaching style and behavior.', 286, 1, true, '2019-11-09 16:39:44.033589');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (44, 'The aim of this monograph is to describe the main concepts and recent - vances in multiscale ?nite element methods. This monograph is intended for thebroaderaudienceincludingengineers,appliedscientists,andforthosewho are interested in multiscale simulations. The book is intended for graduate students in applied mathematics and those interested in multiscale compu- tions. It combines a practical introduction, numerical results, and analysis of multiscale ?nite element methods. Due to the page limitation, the material has been condensed. Each chapter of the book starts with an introduction and description of the proposed methods and motivating examples. Some new techniques are introduced using formal arguments that are justi?ed later in the last chapter. Numerical examples demonstrating the signi?cance of the proposed methods are presented in each chapter following the description of the methods. In the last chapter, we analyze a few representative cases with the objective of demonstrating the main error sources and the convergence of the proposed methods. A brief outline of the book is as follows. The ?rst chapter gives a general introductiontomultiscalemethodsandanoutlineofeachchapter.Thesecond chapter discusses the main idea of the multiscale ?nite element method and its extensions. This chapter also gives an overview of multiscale ?nite element methods and other related methods. The third chapter discusses the ext- sion of multiscale ?nite element methods to nonlinear problems. The fourth chapter focuses on multiscale methods that use limited global information.', 280, 1, true, '2019-11-09 16:39:43.518353');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (45, 'Focussing on theoretical aspects of the small-strain theory of hardening elastoplasticity, this monograph provides a comprehensive and unified treatment of the mathematical theory and numerical analysis, exploiting in particular the great advantages gained by placing the theory in a convex analytic context. Divided into three parts, the first part of the text provides a detailed introduction to plasticity, in which the mechanics of elastoplastic behaviour is emphasised, while the second part is taken up with mathematical analysis of the elastoplasticity problem. The third part is devoted to error analysis of various semi-discrete and fully discrete approximations for variational formulations of the elastoplasticity.', 281, 1, true, '2019-11-09 16:39:43.530413');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (46, 'One of the leading causes of automobile accidents is the slow reaction of the driver while responding to a hazardous situation. State-of-the-art wireless electronics can automate several driving functions, leading to significant reduction in human error and improvement in vehicle safety. With continuous transistor scaling, silicon fabrication technology now has the potential to substantially reduce the cost of automotive radar sensors. This book bridges an existing gap between information available on dependable system/architecture design and circuit design. It provides the background of the field and detailed description of recent research and development of silicon-based radar sensors. System-level requirements and circuit topologies for radar transceivers are described in detail. Holistic approaches towards designing radar sensors are validated with several examples of highly-integrated radar ICs in silicon technologies. Circuit techniques to design millimeter-wave circuits in silicon technologies are discussed in depth.', 282, 1, true, '2019-11-09 16:39:43.543985');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (80, 'This book develops a machine-learning framework for predicting economic growth. It can also be considered as a primer for using machine learning (also known as data mining or data analytics) to answer economic questions. While machine learning itself is not a new idea, advances in computing technology combined with a dawning realization of its applicability to economic questions makes it a new tool for economists.', 318, 1, true, '2019-11-09 16:39:45.905027');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (47, 'John Eargle''s 4th edition of The Handbook of Recording Engineering is the latest version of his long-time classic hands-on book for aspiring recording engineers. It follows the broad outline of its predecessors, but has been completely recast for the benefit of today''s training in recording and its allied arts and sciences. Digital recording and signal processing are covered in detail, as are actual studio miking and production techniques -- including the developing field of surround sound. As always, the traditional topics of basic stereo, studio acoustics, analog tape recording, and the stereo LP are covered in greater detail than you are likely to find anywhere except in archival references. This book has been completely updated with numerous new topics added and outdated material removed. Many technical descriptions are now presented in Sidebars, leaving the primary text for more general descriptions. Handbook of Recording Engineering, Fourth Edition is for students preparing for careers in audio, recording, broadcast, and motion picture sound work. It will also be useful as a handbook for professionals already in the audio workplace.', 283, 1, true, '2019-11-09 16:39:43.559536');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (48, 'Introduction to and survey of parameter estimation; Probability; Introduction to statistics; Parameter estimation methods; Introduction to linear estimation; Matrix analysis for linear parameter estimation; Minimization of sum of squares functions for models nonlinear in parameters; Design of optimal experiments.', 284, 1, true, '2019-11-09 16:39:43.565247');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (73, 'Erstes Kapitel Das materialwirtschaftliche Optimum als betriebliche Zielsetzung.- A. Das Wesen der Materialwirtschaft.- I. Begriff und Arten des Materials.- II. Begriff der Materialwirtschaft.- III. Bedeutung der Materialwirtschaft in den Betriebsarten.- IV. Aufgaben der Materialwirtschaft.- B. Das Problem des materialwirtschaftlichen Optimums.- I. Analyse des materialwirtschaftlichen Optimums.- a) Mengenproblem.- b) Sortimentsproblem.- c) Raumüberbrückungsproblem.- d) Zeitproblem.- e) Kapitalproblem.- f) Kostenproblem.- II. Prinzipien der Materialbereitstellung als Lösungsmöglichkeiten.- a) D.', 310, 1, true, '2019-11-09 16:39:45.392008');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (49, 'During the past two decades, many communication techniques have been developed to achieve various goals such as higher data rate, more robust link quality,andmoreusercapacityinmorerigorouschannelconditions.Themost well known are, for instance, CDMA, OFDM, MIMO, multiuser OFDM, and UWB systems.All these systems havetheir ownunique superioritywhile they also induce other drawbacks that limit the system performance. Conventional way to overcome the drawback is to impose most of the computational e?ort in the receiver side and let the transmitter design much simpler than receiver. The fact is that, however, by leveraging reasonable computational e?ort to the transmitter, the receiver design can be greatly simpli?ed. For instance, multiaccess interference (MAI) has long been considered to limit the perf- mance of multiuser systems. Popular solutions to mitigate MAI issue include multiuser detection (MUD) or sophisticated signal processing for interference cancellation such as PIC or SIC. However, those solutions impose great b- den in the receiver. In this case, precoding o?er good solutions to achieve simple transceiver designs as we will mention later in this book. This book is intended to provide a comprehensive review of precoding techniques for digital communications systems from a signal processing p- spective. The variety of selected precoding techniques and their applications makes this book quite di?erent from other texts about precoding techniques in digital communication engineering.', 285, 1, true, '2019-11-09 16:39:43.570843');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (52, 'First published in 1887, this early work of comparative mythology remains a vital resource to students and devotees of ethnography, history, and world legends. Lang''s stunningly comprehensive overview of pre-scientific thinking provide In Volume Two, Lang explores the concept the "the divine" as it has manifested itself around the world, examines the importance of ritual, and delves particularly into the mythologies of ancient Egypt, Greece, Mexico, and India to demonstrate Scottish journalist and author ANDREW LANG (1844-1912), the son of the sheriff-clerk of rural Selkirkshire, was educated at Edinburgh Academy, the Universities of St. Andrews and Glasgow, and Balliol College, Oxford. A contemporary and friend of Robert', 288, 1, true, '2019-11-09 16:39:44.054145');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (58, 'Together we shared a mostly happy journey — facing and overcoming obstacles, meeting fascinating people wherever we went while falling completely in love with the people of Kenya. This book is a tribute to my co-laborers and in writing this book I hope to show that one does not need to be a hero to step out, take risks and make the world a better, healthier and happier place. –Jack O’Leary An archbishop, an environmentalist and an AIDS activist are only a few of the heroes, who stood up against a ruthless dictator and corrupt government, in Jack O’Leary’s My Road to Kenya. My Road to Kenya shines a light on a group of everyday heroes who believe they were called to make a difference in the lives of the people of Kenya. Fate and faith led them to the crossroads where their paths converged. Working together they have built and supplied hospitals, clinics, schools, churches, and homes for hundreds of children— many of whom were orphaned by HIV/AIDS. Through it all they asked for nothing for themselves. Yet in the end, the collaborations of these everyday heroes resulted in something invaluable — the forging of deep and long-lasting friendships.', 294, 1, true, '2019-11-09 16:39:44.091163');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (59, 'Mother Ann Lee, founder of the Shakers, articulated a vision of a community that embraced sacrifice over the needs of the individual; the result was one of the most successful utopian experiments of nineteenth-century America. The Shakers, an idealistic offshoot of the ascetic Quaker religion, grew to as many as six thousand members in nineteen communities reaching from New England to the Midwest. Lee’s experiment, focused mainly on simplicity, celibate communal living, and sexual equality, provided a model of prosperity for more than one hundred years. Founded in 1806, Shaker Village of Pleasant Hill, Kentucky, was a thriving community located in the center of the bluegrass region. After the Civil War, a steadily shrinking membership resulted in the gradual decline of this remarkable community, and the last remaining Shaker to reside at Pleasant Hill died in 1923. In the years immediately following, it appeared as though the village would fall prey to neglect and a lack of historic preservation. In 1961, however, local citizens formed a private not-for-profit organization to preserve and restore the village and to interpret the rich heritage of the Pleasant Hill Shakers for future generations. Over several years, and against incredible odds, this group succeeded in raising the funds necessary for the restoration projects. By 1968, eight buildings at Shakertown, carefully adapted for modern use while retaining their historical and architectural significance, had been opened to the public. Thomas Parrish’s Restoring Shakertown masterfully explains how the Shaker settlement was saved from the ravages of time and transformed into a nationally renowned landmark of historic preservation. In chronicling how the hopes of the early fund-raisers quickly were challenged by the harsh reality of economic hardships, the book serves as a valuable study in modern philanthropy. Parrish also details the village’s negotiation of legal challenges and how its final plans for creating awareness of the Shakers’ legacy set the standard for later museum developments around the country. In addition to recounting the remarkable history of the formation and eventual demise of the “Shaking Quakers,” Parrish presents a dramatic chronicle of the village’s evolving fortunes. From describing the challenges of financing the restoration to finding preservation experts to achieve the highest standards of authenticity, Restoring Shakertown reveals the complexities and rewards of the preservation of one of Kentucky’s most significant historical and architectural sites.', 295, 1, true, '2019-11-09 16:39:44.093636');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (61, 'Pick up nearly any English Bible today, and you have already encountered Eugene A. Nida-his influence is that widespread. Nida''s dynamic-equivalence approach to Bible translation helped to shape the Good News Bible, the Contemporary English Version, the New International Version, and the New Jerusalem Bible. In addition, Nida''s longtime work with the American Bible Society and collaboration with the United Bible Societies spread his theories and methods around the world. Drawing on archival records and interviews with those who know Nida best, "Let the Words Be Written" examines and assesses the ongoing influence of this scholar of wide-ranging abilities and boundless energy. Bible translators, students and scholars of translation theory or cross-cultural studies, and general readers with an interest in the Bible will find this volume both accessible and enlightening. Paperback edition is available from the Society of Biblical Literature (www.sbl-site.org)', 297, 1, true, '2019-11-09 16:39:44.866176');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (62, 'It started out as the Full Life Study Bible; then it became the Life in the Spirit Study Bible. Now we know it as the new and improved Fire Bible a reference library in one volume. Originally conceived as a tool to help Pentecostal pastors and lay leaders preach, teach, and reach others with the Gospel, this study Bible is now available in the King James Version. It includes extensive notes, background articles on key issues, and authoritative commentary, along with dozens of other unique features. Created by Life Publishers International. "Special Features" Themefinders point readers to 12 major themes of the Pentecostal tradition More than 70 articles explain historical and theological aspects of major topics Study notes for key verses Book introductionsv Subject index; cross-references; concordance In-text maps and charts One-year reading plan; and a color maps section Ribbon markers (except on hardcovers) "', 298, 1, true, '2019-11-09 16:39:44.876763');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (63, 'The Hebrew Bible portrays King Manasseh and child sacrifice as the most reprehensible person and the most objectionable practice within the story of ''Israel''. This monograph suggests that historically, neither were as deviant as the Hebrew Bible appears to insist. Through careful historical reconstruction, it is argued that Manasseh was one of Judah''s most successful monarchs, and child sacrifice played a central role in ancient Judahite religious practice. The biblical writers, motivated by ideological concerns, have thus deliberately distorted the truth about Manasseh and child sacrifice.', 299, 1, true, '2019-11-09 16:39:44.887085');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (64, 'The only complete interlinear Bible available in English-and it''s keyed to Strong''s Exhaustive Concordance! Thousands of pastors, students, and laypeople have found The Interlinear Bible to be a time-saving tool for researching the subtle nuances and layers of meaning within the original biblical languages. Featuring the complete Hebrew and Greek texts with a direct English rendering below each word, it also includes The Literal Translation of the Bible in the outside column. But what truly sets this resource apart are the Strong''s numbers printed directly above the Hebrew and Greek words. Strong''s numbers enable even those with no prior knowledge of Greek or Hebrew to easily access a wealth of language reference works keyed to Strong''s-Greek/Hebrew dictionaries, analytical lexicons, concordances, word studies, and more. The Hebrew is based on the Masoretic Text and the Greek is from the Textus Receptus. The sources of the texts are documented in the preface, and are essentially the same (with some minor variations) to the Hebrew and Greek texts used by the KJV translators. Only a small minority of Bible students ever achieve the ability to read the original biblical languages. This resource offers a non-threatening tool for those lacking language training to begin exploring the languages of Scripture. Conveniently includes the entire Hebrew and Greek text of the Bible in one place Offering a concise, literal translation of each Greek and Hebrew word, it''s a great jumping off point for in-depth Bible study and text analysis. This Bible displays all the Hebrew, Aramaic, and Greek words of the Bible in the Masoretic Hebrew Text and the Received Greek Text, with literal, accurate English meanings placed directly under each original word in interlinear form, with Strong''s Concordance numbers over each original word, enabling the Bible student (whether knowing the original languages or not) to refer to all lexicons and concordances that have also been coded with Strong''s numbers. 2,936 pages, bound in a bonded leather over boards hardback edition. This new edition has been much improved by a new typesetting of the New Testament (Volume IV), with larger print, the left marginal column containing a newly revised Literal Translation of the Bible (2000), and a right marginal column containing the Authorized/King James Version (1769). The three volume Old Testament is an exact reprint of the 1985 Hendrickson Publishers Edition. The Old Testament does not yet have the 1769 King James Version. The only complete Interlinear Bible is now fully keyed to Strong''s Concordance numbers. The Strong''s numbering above each Hebrew and Greek word - along with the Interlinear text and marginal literal English Translation and the 1769 Authorized King James Version - opens a treasure house of Bible study possibilities for those who wish to understand the Scripture better. It''s use will allow the novice student to read the original text without losing valuable time to look up the meaning of the Hebrew & Greek words in the Hebrew & Greek lexicons. There is no substitute for a first hand knowledge of the original text. However since only a small minority of Bible students retain an easy reading comprehension of the original text, the Interlinear Bible is a welcome aid to Bible students, laymen, and pastors who wish to continue working with the original languages.', 300, 1, true, '2019-11-09 16:39:44.897581');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (65, 'This edition combines the renowned Scofield study notes and reference system with the New King James Version, one of the most popular modern Bible translations. But that''s not all: The fruit of Dr. C. I. Scofield''s decades of reflection on the Word of God have been augmented (not revised) tomake the ideas underlying the ScofieldRG Study Bible''s annotations clearer to modern readers. An abundance of factual information is presented in topical articles, charts, and lists that add depth and richness to study time. Enhanced book introductions, accurate in-text maps, authoritative full colormaps, and page bottom notes broaden the context of the reader''s understanding. This style''s Duradera binding is pleasing to the eye and strong enough to withstand heavy use. These books have sturdy zipper closures that provide an extra measure of protection for the page edges, a feature thattravelers, hospital visitors, and anyone who has ever had their Bible damaged while carrying it in a purse or briefcase will appreciate.', 301, 1, true, '2019-11-09 16:39:44.908443');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (66, 'A Bíblia Conselheira é uma edição original e pioneira. Um grupo de conceituados psicólogos e psiquiatras cristãos — apoiados pelo Corpo de Psicólogos e Psiquiatras Cristãos (CPPC) e pela Sociedade Bíblica do Brasil (SBB) — tem se dedicado à tarefa de comentar o conteúdo terapêutico do texto bíblico, utilizando seus dons e experiência profissional para explicar como as Sagradas Escrituras promovem nossa saúde física, mental e espiritual. O amor de Deus, expresso plenamente em Jesus Cristo — o Maravilhoso Conselheiro — é o principal elemento terapêutico para as nossas feridas. Nosso desejo é que esta mensagem seja amplamente utilizada por Deus para comunicar acolhimento, reflexão e graça para todos os indivíduos e grupos que dele se aproximam. O texto bíblico utilizado é o da Nova Tradução na Linguagem de Hoje (NTLH), e as notas de estudo aparecem entre os versículos bíblicos em forma de comentários. Este volume sobre o livro de Salmos é mais um da série de ebooks da Bíblia Conselheira, no desejo de que o Maravilhoso Conselheiro faça uso desta edição para trazer descanso e alívio para nossa alma.', 302, 1, true, '2019-11-09 16:39:44.918113');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (67, 'From the Constitution to the Bible, from literary classics to political sound bites, our modern lives are filled with numerous texts that govern and influence our behavior and beliefs. Whether in the courtrooms of our judiciaries or over our dining room tables, we argue over what these texts mean as we apply them to our lives. Various schools of hermeneutics offer theories of how we generally understand the world around us or how to read certain types of texts to arrive at the correct or best interpretation, but most neglect the argumentative and persuasive nature of every act of interpretation. In Arguing over Texts, Martin Camper presents a rhetorical method for understanding the types of disagreement people have over the meaning of texts and the lines of argument they use to resolve those disagreements. Camper''s fresh approach has its roots in the long forgotten interpretive stases, originally devised by ancient Greek and Roman teachers of rhetoric for inventing courtroom arguments concerning the meaning of legal documents such as wills, laws, and contracts. The interpretive stases identify general, recurring debates over textual meaning and catalogue the lines of reasoning arguers may employ to support their preferred interpretations. Drawing on contemporary research in language, persuasion, and cognition, Camper expands the scope of the interpretive stases to cover textual controversies in virtually any context. To illustrate the interpretive stases'' wide range of applicability, Arguing over Texts contains examples of interpretive debates from law, politics, religion, history, and literary criticism. Arguing over Texts will appeal to anyone who is interested in analyzing and constructing interpretive arguments.', 303, 1, true, '2019-11-09 16:39:44.922897');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (68, '"A loucura de Deus é mais sábia que os homens e a fraqueza de Deus é mais forte que os homens" (1Cor 1,25). Rejeitado pela família, de modo que "nem mesmo os seus irmãos acreditavam nele" (Jo 7,5), e abandonado por grande parte dos seus seguidores "muitos dos seus discípulos se afastaram e não andavam mais com ele", (Jo 6,66), para as autoridades judaicas Jesus é apenas um louco, um obcecado (Jo 8,48). Somente um louco, um samaritano endemoninhado, podia, com efeito, denunciar os chefes religiosos como filhos do diabo e assassinos (Jo 8,48), e desejar o fim da instituição religiosa que se acreditava fosse desejada pelo próprio Deus.', 304, 1, true, '2019-11-09 16:39:44.926362');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (69, 'Das erste Buch, das gezielt auf Case-Study-Einstellungsverfahren bei Unternehmensberatungen vorbereitet. Die Autoren stellen Portraits der TOP 20 unter den deutschen Unternehmensberatungen und die Grundkonzepte der Case-Study-Bearbeitung vor.', 305, 1, true, '2019-11-09 16:39:45.363228');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (70, 'This title begins with an insightful synopsis of the business of the internet. This sets the stage for understanding the business principles that follow. The book also includes a step-by-step owner''s manual, designed to give readers the tools they need to drive the net to greater profitability within their own business.', 306, 1, true, '2019-11-09 16:39:45.378157');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (71, 'Explores the concept of complexity and analyses how organizational governance can contribute to environmental sustainability. A common theme in these chapters is that organizations actively engage with their environments. Consequently, organizational responses are partly the result of iterative processes with the environment.', 308, 1, true, '2019-11-09 16:39:45.383883');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (81, 'In today’s global and highly competitive environment, continuous improvement in the processes and products of any field of engineering is essential for survival. This book gathers together the full range of statistical techniques required by engineers from all fields. It will assist them to gain sensible statistical feedback on how their processes or products are functioning and to give them realistic predictions of how these could be improved. The handbook will be essential reading for all engineers and engineering-connected managers who are serious about keeping their methods and products at the cutting edge of quality and competitiveness.', 319, 1, true, '2019-11-09 16:39:45.914552');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (74, 'Ever since A.C.Cournot(1838), economists have been increasingly interested in oligopoly, a state of industry where firms producing homogeneous goods or close substitutes are limited in number. The fewness of firms in oligopoly gives rise to interdependence which they have to take into account in choosing their optimal output or pricing policies in each production period. Since each firm''s profit is a function of all firms'' outputs in an oligopoly without product differ entiation, each firm in choosing its optimal output in any period has to know beforehand all other rival firms'' outputs in the same period. As this is in general impossible, it has to form some kind of expecta tion on other firms'' most likely outputs. Cournot thought that in each period each firm assumed that all its rivals'' outputs would remain at the same level as in the preceding period. Needless to say, the Cournot assumption is too naive to be realistically supported. However, the Cournot profit maximizing oligopoly model characterized by this assumption has many important and attractive properties from the view point of economic theory and provides a frame of reference for more realistic theories of oligopoly. In Chapters 1-3, we shall be engaged in analyzing the Cournot oligopoly model in greater detail from the viewpoints of existence, stability, uniqueness and quasi-competitive ness of the equilibrium.', 311, 1, true, '2019-11-09 16:39:45.394464');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (75, 'This volume presents a selection of the presentations from the first annual conference on Analytical Methods in Software Engineering Economics held at The MITRE Corporation in McLean, Virginia. The papers are representative of the issues that are of interest to researchers in the economics of information systems and software engineering economics. The 1990s are presenting software economists with a particularly difficult set of challenges. Because of budget considerations, the number of large new software development efforts is declining. The primary focus has shifted to issues relating to upgrading and migrating existing systems. In this environment, productivity enhancing methodologies and tools are of primary interest. The MITRE Software Engineering Analysis Conference was designed to address some of th,~ new and difficult challenges that face our profession. The primary objective of the conference was to address new theoretical and applications directions in Software Engineering Economics, a relatively new discipline that deals with the management and control of all segments of the software life-cycle. The discipline has received much visibility in the last twenty-five years because of the size and cost considerations of many software development and maintenance efforts, particularly in the Federal Government. We thank everyone who helped make this conference a success, especially those who graciously allowed us to include their work in this volume.', 312, 1, true, '2019-11-09 16:39:45.397051');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (76, 'Dieses Buch erläutert fundiert und pragmatisch alle entscheidenden Erfolgsfaktoren des Influencer Marketings – sowohl für Unternehmen als auch für Influencer.Marketingprofis erfahren, wie sie Influencer Marketing bestmöglich in ihre Kommunikationsstrategie integrieren, wie sie die passenden Influencer finden und nach welchen konkreten Regeln die Zusammenarbeit optimal funktioniert: von der Vertragsgestaltung über das Briefing bis hin zum Monitoring. Zudem werden viele nützliche Plattformen, Netzwerke und Instrumente vorgestellt.Influencer erhalten wertvolle Anregungen, wie sie ihre Karriere weiter professionalisieren können und lernen aus Erfahrungsberichten und Empfehlungen von erfolgreichen Akteuren im Markt.Als wichtiges und erfolgskritisches Thema werden auch die wettbewerbsrechtlichen Grundlagen des Influencer Marketing verständlich und handlungsorientiert dargestellt. Ein unverzichtbares Grundlagenwerk, das zeigt, wie sich das mitunter fragile Zusammenspiel beider Seiten effizient, langfristig und vor allem für alle Seiten gewinnbringend gestalten lässt. Auszug aus dem Inhalt Wie sieht das Marketing im Influencer-Zeitalter aus? Markenstrategischer Fit im Influencer Marketing Wettbewerbsrechtliche Grundlagen von Influencer Marketing Plattformen, Instrumente und Netzwerke im Influencer Marketing Professionalisierung für Influencer über Netzwerke Erfahrungsberichte von Influencern 14 strukturiert aufgearbeitete Fallbeispiele, u.a. aus den Branchen Drogerie, Food, Technik und Medien Die Herausgeberin Marlis Jahnke begleitet die Szene seit vielen Jahren und hat mit HashtagLove eine der ersten und erfolgreichsten Influencer-Marketing-Plattformen in Deutschland gelauncht. Beitragsautoren im Werk sind Professor Regina Brix, Dr. Annette Bruce, Thomas Fuchs, Dr. Caroline Hahn, Fabian Held, Hendrik Martens, Moritz Meyer, André Krüger, Melanie Lammers, Franziska von Lewinski, Monika Sekara und Simon Unge.', 313, 1, true, '2019-11-09 16:39:45.399620');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (77, 'Canada and the countries of Latin America are in the midst of major changes and choices in the area of labor markets and related social policy. These decisions are likely to have profound consequences for the quality of life of workers throughout the hemisphere. Labor Market Policies in Canada and Latin America: Challenges of the New Millennium reviews the evidence of Canada and Latin America on three major labor policy instruments - unemployment insurance, minimum wages and training - and on the effects of the payroll taxes which are the main means of funding the unemployment insurance system and other components of social expenditure. This is the first study attempting an in-depth comparison of these labor policy instruments between Canada and Latin America. The useful juxtaposition of Canadian and Latin American experiences comes at a time when the trend in Canada is to back away from the perhaps overly generous or ineffectively administered elements of the labor legislation/social security net and when Latin American countries have undertaken significant reforms of their past systems but require further changes to move toward the sorts of legislation and support systems that characterize developed countries. The experiences of Canada and Latin America are mutually relevant since all are small economies forced to adjust to events at the world or hemispheric level and most are inclined to approach policy in an intermediate fashion which falls between the more market-oriented American and the more interventionist European models. Together with its comparative aspect, this volume attempts a more balanced and in-depth assessment in each of the policy areas than has hitherto been available. The gradually increasing base of available empirical data on the period after the reforms has been used in the studies, which provide thorough syntheses of the available research for Canada and Latin America.', 314, 1, true, '2019-11-09 16:39:45.869310');
INSERT INTO public.book_overviews (book_overview_id, description, book_id, user_id, published, creation_time) VALUES (79, 'This book explores the rise of consumerism and the expanding variety of goods available in Japan. Japan is placed within the comparative context of the ''consumer revolution'' in Europe and North America, contributing to the analysis of the ways in which consumption and everyday life change in the course of economic development.', 317, 1, true, '2019-11-09 16:39:45.894854');
